INSERT INTO `films` VALUES (45,'Побег из Шоушенка','Бухгалтер **Энди Дюфрейн** обвинён в убийстве собственной жены и её любовника. Оказавшись в тюрьме под названием **Шоушенк**, он сталкивается с жестокостью и беззаконием, царящими по обе стороны решётки. Каждый, кто попадает в эти стены, становится их рабом до конца жизни. Но **Энди**, обладающий живым умом и доброй душой, находит подход как к заключённым, так и к охранникам, добиваясь их особого к себе расположения.',1994,'США',' Фрэнк Дарабонт',' Фрэнк Дарабонт, Стивен Кинг','Тим Роббинс, Морган Фриман, Боб Гантон, Уильям Сэдлер, Клэнси Браун',142,25),(46,'Зеленая миля','**Пол Эджкомб** - начальник блока смертников в тюрьме «Холодная гора», каждый из узников которого однажды проходит «зеленую милю» по пути к месту казни. Пол повидал много заключённых и надзирателей за время работы. Однако гигант Джон Коффи, обвинённый в страшном преступлении, стал одним из самых необычных обитателей блока.',1999,'США',' Фрэнк Дарабонт',' Фрэнк Дарабонт, Стивен Кинг','Том Хэнкс, Дэвид Морс, Бонни Хант, Майкл Кларк, Дункан Джеймс Кромуэлл',189,26),(47,'Интерстеллар','Когда засуха, пыльные бури и вымирание растений приводят человечество к продовольственному кризису, коллектив исследователей и учёных отправляется сквозь червоточину (которая предположительно соединяет области пространства-времени через большое расстояние) в путешествие, чтобы превзойти прежние ограничения для космических путешествий человека и найти планету с подходящими для человечества условиями.',2014,'США, Великобритания, Канада',' Кристофер Нолан',' Джонатан Нолан, Кристофер Нолан','Мэттью МакКонахи, Энн Хэтэуэй, Джессика Честейн, Маккензи Фой',169,27);
