INSERT INTO `reviews` VALUES (3,47,1,4,'Кристофер Нолан безоговорочно уникальный режиссёр: он единственный, кто делает глубокие, умные и сложные (иногда чересчур) блокбастеры, и тем самым охватывает огромную аудиторию: от любителей попкорна до любителей артхауса. Я смотрел «Интерстеллар» три раза: первый в кинотеатре я провёл с открытым ртом, второй дома с закрытым ртом, но все ещё восхищенный, и третий мне уже стали бросаться в глаза минусы и недочёты фильма, но даже с ними это все-равно невероятная и выдающаяся картина.\r\n\r\nУ меня не возникает желания искать недочёты с точки зрения астрофизики, хотя безусловно они есть, но это все-таки художественное кино, и на многое можно закрыть глаза. Но у меня есть несколько серьёзных вопросов к сюжету, наличие которых не позволяет назвать «Интерстеллар» шедевром. Первый: неужели в будущем проблему с песчаными бурями и болезнями пшеницы нельзя решить иначе, кроме как отправить людей в другие галактики? Очевидно же, что Земля даже с учётом всех проблем все равно более пригодна для жизни, чем любая другая планета. Второй: герой Купера случайно попадает на базу NASA и ему тут же выкладывают секретную информацию и без опыта берут пилотировать космический корабль на миссию по спасению человечества. Третий: профессор Бранд-старший сам же рассказывает, что отправляет в космос людей, которых особо ничего не держит на земле, при этом в миссии участвуют его собственная дочь и отец-одиночка Купер. Список можно продолжить, также как и можно постараться логично обьяснить эти моменты, но факт остаётся фактом: в «Интерстелларе» есть базовые сюжетные дыры, которые сложно не заметить.\r\n\r\nПлюсы и достоинства работы Нолана довольно-таки очевидны, и что важно, они все-таки перекрывают недостатки. Для начала, Нолан вновь создал свой мир: масштабный, впечатляющий, завораживающий, пугающий и прекрасный одновременно. Конечно многое уже мы видели и у Тарковского, и у Лукаса и конечно у Кубрика, но Нолан не стесняется заимствовать лучшее и успешно интегрирует это в свою историю. Нельзя не отметить многогранность и многозадачность «Интерстеллара», я искренне не понимаю людей, которые судят однобоко и называет его «голливудской жвачкой». Это в первую очередь кино о нашем месте во вселенной, о понятии дома для человека, о любви, которая не подчиняется законам физики, о сложности и невозможности выбора, и уже только потом о космических путешествиях. Актерская игра на высоком уровне, ничего гениального нет, но все основные персонажи раскрыты и проработаны. МакКонахи воплотил сильный мужской образ, одновременно твердый и уверенный в себе, но проносящий внутри ту боль и страдания, на которые он себя обрёк. Ну и вишню на торт плавно опускает композитор Ханс Зиммер, который опять написал идеально подходящую музыку: в ней чувствуется и необъятность далёкого космоса и тревожная неизбежность течения времени, и при этом какая-то душевная близость и спокойствие, дающее надежду на успешный исход судьбы человечества.\r\n\r\nБезусловно, «Интерстеллар» - кино не идеальное и неоднозначное, Нолан замахнулся на очередную неподъёмную высоту, дал поводы поругать себя, особенно «я тоже в какой-то мере учёным», но в конечном итоге достиг цели, вновь заставил восхищаться своей работой и уверенно установил свой флаг на планете космического кинематографа.','2021-01-23 23:21:29'),(4,45,5,4,'После просмотра, должен сказать, что каждый должен посмотреть эту картину. И сейчас я дам вам причины, почему вы сейчас же это сделаете.\r\n\r\nГлавным героем фильма является Энди Дюфрейн, который попадает в тюрьму за убийство своей жены и ее любовника. Обычный казалось бы банкир, который имеет цель и надежду, идущий каждый день к ней.\r\n\r\nВ тюрьме обретает новых друзей, с которыми коротает время, проходя в это время через череду препятствий, о которых я не скажу ни слова, вы сами должны это увидеть. Двигаясь по своему пути Энди за 19 лет ни капли не потерял в надежде.\r\n\r\nНадежда является, можно сказать, главной идеей произведения. Мы видим разные взгляды на нее от двух, на первый взгляд противоположных каст людей. Такие как Энди, имея надежду, могут пройти через любую череду проблем, другие же, как их называет лучший друг Энди, люди тюрьмы считают надежду пустым звуком, который не значит ничего, ведь шансов выбраться из тюрьмы нет, какая тут надежда, на что надеяться.\r\n\r\nФильм имеет героев со своими историями, за которыми интересно наблюдать, каждый имеет что-то свое, кто-то прожил 50 лет в тюрьме и не может жить на свободе, для него свобода становится своеобразной тюрьмой. Другой честно признает свою вину за преступление, казалось бы, ты под арестом, в чем смысл пытаться строить из себя невиновного, но как оказывается такие есть, имеется даже своя фраза \'меня поимел адвокат\', которая как мне кажется появилась из-за того, что человек не хотел признавать вины, но суд вынес ему приговор, а отвечать что-то нужно, когда спрашивают, за что \'сел\'.\r\n\r\nПосле попадания Энди в тюрьму, все поменялось, сам Энди, его друзья, даже тюрьма. Энди поменялся, но все еще знал, что ему нужно делать, как выйти из любой ситуации победителем.\r\n\r\nВесь фильм повторяется фраза \'Осужденный готов делать что угодно, чтобы мозг чем-либо занимался\'. Как мне кажется, Энди был из того типа людей, которому нужно думать, что-то \'творить\', поэтому днём он занимался делами в тюрьме, а его любимое занятие ждало ночи.\r\n\r\nЭнди подмечает, что он \'просто осужденный, который умеет проводить финансовое планирование\', в финале мы видим, что данное планирование всецело помогает ему держать курс к мечте. Все кирпичики собираются в стену.\r\n\r\nЗавершить хотел бы слова из фильма: \'Надежда - лучшая из вещей. Она никогда не умирает\'.\r\n\r\nНадеюсь я смог заинтересовать вас, чтобы вы потратили 2 часа на кое-что прекрасное. Ведь, каждый может найти что-то свое в этой картине, а я из своего сказал только часть.','2021-01-23 23:33:10'),(5,45,1,4,'Первый раз этот фильм я посмотрел по телевизору, я был школьником и делал под этот фильм уроки, лежа на полу в выходные. Обычно я включал какую-то \'болталку\' на фоне, чтобы не было скучно. Я не особо концентрировался на происходящей. Но как сейчас, помню, что \'Побег из Шоушенка\' с первых минут завлек меня и заставил отложить уроки на пару часов. Тогда мне просто нравилась атмосфера происходящего и действия, которые происходят на экране. Я не сильно вдавался в детали. Пересмотрев, уже в более осознанном возрасте, я просто влюбился в этот фильм. Это не просто популярное и красивое кино, это настоящее искусство, философское произведение. Скажу сразу, книгу я не читал, потому не могу сопоставить. Оцениваю исключительно фильм.\r\n\r\nДействие фильма происходит в тюрьме. Причем тюрьма эта очень особого режима. Атмосфера, происходящее вокруг, люди - все это очень угнетает зрителя. Любой бы сломался, но только не наш герой.\r\n\r\nЭнди Дюферейн действительно не такой как все, он из другого текста. Казалось бы, в таком простом и слабом с виду человеке, кроется столько силы, выдержки и мужества. В этом и кроется, как по мне, главный посыл этой работы. Мужайтесь, крепитесь идите к своей цели не отсутупая и все у вас будет. Конечно, Энди живой человек, он тоже испытывает эмоции, боится и переживает. Но его мысли не с нами, они сконцентрированы на цели. Причем зритель далеко не сразу этого замечает. Дюфрейн силен еще тем, что он из тех людей, которые не теряют своего лица, остаются добры и порядочны к окружающим несмотря ни на что. Я считаю, что в этом тоже кроется определенного рода сила.\r\n\r\nМораль предельно проста, кто-то считает, что этот фильм о внутренней свободе, кто-то считает что он о дружбе и все это правильно. Однако, я считаю, что этот фильм о безграничной силе человека - о внутреннем стержне, тяге к светлому и благородному. Имея такую силу, мы фактически неуязвимы. Идите к своей цели несмотря ни на что, не теряя при этом благородства и трезвого рассудка.','2021-01-23 23:41:53'),(6,46,5,4,'Не читая книгу, мне трудно судить насколько фильм соответствует оригинальному повествованию. Но по объективной оценке, если рассматривать его не ссылаясь на первоисточник, фильм выглядит впечатляюще.\r\n\r\nГлавное достоинство Зеленой Мили — это затрагивание действительно серьёзных философских тем и подталкиванием на размышления о добре и зле.\r\n\r\nГлавному герою, Полу Эджкомбу, работающему надзирателем в федеральной тюрьме, доведётся пройти множество испытаний: сделать трудный выбор между выполнением обязанностей или действовать по зову сердца, так же ему доведётся повидать много неоднозначных людей, что заключены в тюрьме по разным причинам. Казалось бы, все они преступники, совершавшие ужасные преступления, но среди них имеются как и откровенные подонки, так и с виду хорошие люди. В фильме присутствует достаточно яркое деление на плохих и хороших, что мне не особо понравилось, но на самом деле играет немаловажную роль для всего сюжета. Поэтому это может остаться лишь моей личной незначительной придиркой.\r\n\r\nСценаристы над фильмом поработали на славу. Пусть сюжет серьёзен, но его повествование идёт размеренно и легко, что позволяет полностью все понять и погрузиться в сюжет с головой. Он затягивает буквально с первых минут просмотра. Здесь на плюс так же играет хорошо проработанная атмосфера с реалистичными локациями и даже местным лексиконом персонажей.\r\n\r\nОтдельно могу выделить режиссёрскую работу с плавными движениями камер, приятной тёплой цветовой гаммой, что отлично нагоняет атмосферу в фильме. Это все так же способствует полному погружению в сюжет.\r\n\r\nСмело могу порекомендовать этот фильм к просмотру, но с одним небольшим уточнением: его стоит смотреть все же взрослым людям. Тема философии многогранна, в неё стоит вникать и её стоит обдумывать. Суть фильма в полной мере может понять лишь тот, кто пожил в этом мире и набрался какого-либо жизненного опыта.','2021-01-24 13:29:42');
